// App.js
import React from 'react';
import { NavigationContainer, ThemeProvider } from '@react-navigation/native';
import { createDrawerNavigator } from '@react-navigation/drawer';
import configuracion_usuario from './components/configuracion_usuario';


const Drawer = createDrawerNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <ThemeProvider> 
        <Drawer.Navigator initialRouteName="Inicio">
          <Drawer.Screen name="Inicio" component={categorias} />
          <Drawer.Screen name="Configuracion" component={configuracion_usuario} />
        </Drawer.Navigator>
      </ThemeProvider>
    </NavigationContainer>
  );
}
